n\\n- Discuss potential approaches we could take which are:\\n\\n    - Implement as a separate app\\n\\n    - Implement as a framework\\/library\\n\\n    - Implement directly in the current mobile app \\n\\n- Talk about reusing code as much as possible and what are the potential pitfalls?\\n\\n- Talk about release process and how we would like to be able to release (internally) more frequently than the mobile app is released.\\n\\n- Talk about the MAG group and what exactly we need to prepare for them\\n\\nIf you have any more topics to discuss just let me know. For the topics above I would like to use maximum of 45 minutes + 10 minutes for additional discussions that may happen so 55 minutes in total.\\n\\nRegards\\n\\nPawe\\u0142 Kulikowski\",\"content\":[{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"Hello,\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"I would like to invite you all to discuss the approach we might want to take with Canvas mobile experience implementation.\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"The agenda would look more or less like this:\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"- Discuss potential approaches we could take which are:\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"    - Implement as a separate app\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"    - Implement as a framework\\/library\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"    - Implement directly in the current mobile app \"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"- Talk about reusing code as much as possible and what are the potential pitfalls?\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"- Talk about release process and how we would like to be able to release (internally) more frequently than the mobile app is released.\"}]},{\"type