Id\":\"20651395982\",\"createdTs\":1679923932,\"data\":{\"type\":\"link\",\"id\":\"87802569-c9d4-4e16-9e2c-c4803e162f1a\",\"linkStyle\":{\"lineType\":\"bezier\",\"strokeWidth\":1,\"stroke\":\"#222222\",\"strokeType\":\"solid\"},\"dest\":{\"icon\":\"arrow\",\"x\":0,\"y\":0.5,\"widgetId\":\"dafce32a-8bbb-44fb-9501-b5acdbd56dca\"},\"start\":{\"icon\":\"none\",\"x\":1,\"y\":0.5,\"widgetId\":\"e381308a-1c1f-428f-9eff-93eaf939575e\"},\"metrics\":{\"position\":\"absolute\",\"scale\":1,\"rotation\":0,\"saveRatio\":false,\"x\":0,\"y\":0},\"z\":\"1411111\"},\"lastModifiedTs\":1679923932,\"lastModifiedBy\":\"20651395982\"},{\"id\":\"47283105-3b79-49d3-ab0c-b0dd2d7aca88\",\"userId\":\"20651395982\",\"createdTs\":1679923934,\"data\":{\"type\":\"text\",\"id\":\"47283105-3b79-49d3-ab0c-b0dd2d7aca88\",\"textStyle\":{\"fontFamily\":\"Lato\",\"color\":\"#222222\",\"fontSize\":30,\"fontWeight\":\"400\",\"fontStyle\":\"normal\",\"highlightColor\":\"transparent\",\"lineHeight\":1.2},\"colors\":{\"fill\":\"transparent\"},\"content\":{\"text\":\"Hello,\\n\\nI would like to invite you all to discuss the approach we might want to take with Canvas mobile experience implementation.\\n\\nThe agenda would look more or less like this:\\n\\n- Discuss potential approaches we could take which are:\\n\\n    - Implement as a separate app\\n\\n    - Implement as a framework\\/library\\n\\n    - Implement directly in the current mobile app \\n\\n- Talk about reusing code as much as possible and what are the potential pitfalls?\\n\\n- Talk about release process and how we would like to be able to release (internally) more frequently than the mobile app is released.\\n\\n- Talk about the MAG group and what exactly we need to prepare for them\\n\\nIf you have any more topics to discuss just let me know. For the topics above I would like to use maximum of 45 minutes + 10 minutes for additional discussions that may happen so 55 minutes in total.\\n\\nRegards\\n\\nPawe\\u0142 Kulikowski\",\"content\":[{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"Hello,\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"I would like to invite you all to discuss the approach we might want to take with Canvas mobile experience implementation.\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"The agenda would look more or less like this:\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"- Discuss potential approaches we could take which are:\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"    - Implement as a separate app\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"    - Implement as a framework\\/library\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"    - Implement directly in the current mobile app \"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"- Talk about reusing code as much as possible and what are the potential pitfalls?\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"- Talk about release process and how we would like to be able to release (internally) more frequently than the mobile app is released.\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"- Talk about the MAG group and what exactly we need to prepare for them\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"If you have any more topics to discuss just let me know. For the topics above I would like to use maximum of 45 minutes + 10 minutes for additional discussions that may happen so 55 minutes in total.\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"Regards\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"text\":\"Pawe\\u0142 Kulikowski\"}]}],\"type\":\"doc\"},\"metrics\":{\"position\":\"absolute\",\"scale\":1,\"rotation\":0,\"w\":893,\"h\":792,\"saveRatio\":false,\"x\":3080,\"y\":-1123},\"z\":\"1371\"},\"lastModifiedTs\":167992