"0ba31faf-43ab-4883-a0ee-2ff4e4629f4e\",\"userId\":\"20651395982\",\"createdTs\":1679923938,\"data\":{\"type\":\"link\",\"id\":\"0ba31faf-43ab-4883-a0ee-2ff4e4629f4e\",\"linkStyle\":{\"lineType\":\"bezier\",\"strokeWidth\":1,\"stroke\":\"#222222\",\"strokeType\":\"solid\"},\"dest\":{\"icon\":\"arrow\",\"x\":0.5,\"y\":1,\"widgetId\":\"1566c868-3db4-4deb-ac91-d9eef846c5fa\"},\"start\":{\"icon\":\"none\",\"x\":0.5,\"y\":0,\"widgetId\":\"b871f355-880f-48a8-9862-97fafac0d519\"},\"metrics\":{\"position\":\"absolute\",\"scale\":1,\"rotation\":0,\"saveRatio\":false,\"x\":0,\"y\":0},\"z\":\"181\"},\"lastModifiedTs\":1679923938,\"lastModifiedBy\":\"20651395982\"},{\"id\":\"4bce54a6-d8e4-4995-b602-317571671793\",\"userId\":\"20651395982\",\"createdTs\":1679923936,\"data\":{\"type\":\"text\",\"id\":\"4bce54a6-d8e4-4995-b602-317571671793\",\"textStyle\":{\"fontFamily\":\"Lato\",\"color\":\"#222222\",\"fontSize\":30,\"fontWeight\":\"400\",\"fontStyle\":\"normal\",\"highlightColor\":\"transparent\",\"lineHeight\":1.2},\"colors\":{\"fill\":\"transparent\"},\"content\":{\"text\":\"Hello,\\n\\nI would like to invite you all to discuss the approach we might want to take with Canvas mobile experience implementation.\\n\\nThe agenda would look more or less like this:\\n\\n- Discuss potential approaches we could take which are:\\n\\n    - Implement as a separate app\\n\\n    - Implement as a framework\\/library\\n\\n    - Implement directly in the current mobile app \\n\\n- Talk about reusing code as much as possible and what are the potential pitfalls?\\n\\n- Talk about release process and how we would like to be able to release (internally) more frequently than the mobile app is released.\\n\\n- Talk about the MAG group and what exactly we need to prepare for them\\n\\nIf you have any more topics to discuss just let me know. For the topics above I would like to use maximum of 45 minutes + 10 minutes for additional discussions that may happen so 55 minutes in total.\\n\\nRegards\\n\\nPa