":[{\"type\":\"highlight\",\"attrs\":{\"color\":\"transparent\"}}],\"text\":\"- Talk about the MAG group and what exactly we need to prepare for them\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"marks\":[{\"type\":\"highlight\",\"attrs\":{\"color\":\"transparent\"}}],\"text\":\"If you have any more topics to discuss just let me know. For the topics above I would like to use maximum of 45 minutes + 10 minutes for additional discussions that may happen so 55 minutes in total.\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"marks\":[{\"type\":\"highlight\",\"attrs\":{\"color\":\"transparent\"}}],\"text\":\"Regards\"}]},{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"marks\":[{\"type\":\"highlight\",\"attrs\":{\"color\":\"transparent\"}}],\"text\":\"Pawe\\u0142 Kulikowski\"}]}],\"type\":\"doc\"},\"metrics\":{\"position\":\"absolute\",\"scale\":1,\"rotation\":0,\"w\":893,\"h\":792,\"saveRatio\":false,\"x\":11887,\"y\":-1795},\"z\":\"13711\"},\"lastModifiedTs\":1679923936,\"lastModifiedBy\":\"20651395982\"},{\"id\":\"9e7a65b7-72e9-4893-aabf-8d9cab4116ea\",\"userId\":\"20651395982\",\"createdTs\":1679923934,\"data\":{\"type\":\"sticky_note\",\"id\":\"9e7a65b7-72e9-4893-aabf-8d9cab4116ea\",\"content\":{\"text\":\"We could have an internal app for testing\",\"content\":[{\"type\":\"paragraph\",\"content\":[{\"type\":\"text\",\"marks\":[{\"type\":\"highlight\",\"attrs\":{\"color\":\"transparent\"}}],\"text\":\"We could have an internal app for testing\"}]}],\"type\":\"doc\"},\"textStyle\":{\"color\":\"#222222\",\"highlightColor\":\"transparent\",\"fontFamily\":\"Lato\",\"fontSize\":21,\"fontAutoSizeEnabled\":true,\"lineHeight\":1.2,\"fontWeight\":\"400\",\"fontStyle\":\"normal\"},\"colors\":{\"fill\":\"#92E0C0\"},\"metrics\":{\"position\":\"absolute\",\"scale\":0.5900641750579982,\"rotation\":0,\"w\":128,\"h\":128,\"saveRatio\":false,\"x\":5332,\"y\":872},\"z\":\"1001\"},\"lastModifiedTs\":1679923934,\"lastModifiedBy\":\"20651395982\